/** @format */

import React, { Fragment, useEffect, useState } from "react";
import "../components/main.css";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import ResponsiveEmbed from "react-bootstrap/ResponsiveEmbed";
import hvr from "hover.css";
import Container from "react-bootstrap/Container";
import axios from "axios";


const Videos=({videos})=> {
const [CurrentPage,SetCurrentPage]=useState(1);
const [videosperpage,setvideosperpage]=useState(9);
  return (
    <div>

   {videos.map((video,id)=>
   <Container fluid={true}>
   <Row className="justify-content-center ">
     
     <Col xl={4} lg={4} md={6} sm={12} xs={12} >
       <div className="text-center">
         <ResponsiveEmbed
           aspectRatio="16by9"
           className="iframcustom hvr-grow"
         >
           <embed src={video.VideoLink} />
         </ResponsiveEmbed>
         <h6 className="videotitlestyle">{video.VideoTitle}</h6>
         <p className="videotextstyle"> {video.VideoSummary}</p>
       </div>
     </Col>
   </Row>
 </Container>

    )
     }  

    </div>
  );
  
}

export default Videos;
